	(499,'_transient_wc_addons_section_popular','O:8:\"stdClass\":1:{s:8:\"products\";a:25:{i:0;O:8:\"stdClass\":5:{s:5:\"title\";s:19:\"WooCommerce iOS App\";s:5:\"image\";s:0:\"\";s:7:\"excerpt\";s:217:\"Keep your finger on the pulse of your online shop with WooCommerce iOS. All of your shop\'s catalog & performance reports are now just a tap away - quickly accessible & beautifully presented right there on your iPhone.\";s:4:\"link\";s:100:\"http://www.woothemes.com/woocommerce-ios/?utm_source=product&utm_medium=upsell&utm_campaign=wcaddons\";s:5:\"price\";s:9:\"&#36;4.99\";}i:1;O:8:\"stdClass\":5:{s:5:\"title\";s:6:\"Stripe\";s:5:\"image\";s:61:\"https://woocommerce.com/wp-content/uploads/2016/08/stripe.png\";s:7:\"excerpt\";s:103:\"Accept Visa, MasterCard, American Express, Discover, JCB, and Diners Club cards directly on your store.\";s:4:\"link\";s:99:\"https://woocommerce.com/products/stripe/?utm_source=product&utm_medium=upsell&utm_campaign=wcaddons\";s:5:\"price\";s:9:\"&#36;0.00\";}i:2;O:8:\"stdClass\":5:{s:5:\"title\";s:10:\"Amazon Pay\";s:5:\"image\";s:88:\"https://woocommerce.com/wp-content/uploads/2013/08/logo-amazonpay-fullcolor-dark-rgb.png\";s:7:\"excerpt\";s:131:\"Amazon Pay is embedded in your WooCommerce store. Transactions take place via Amazon widgets, so the buyer never leaves your site.\";s:4:\"link\";s:108:\"https://woocommerce.com/products/pay-with-amazon/?utm_source=product&utm_medium=upsell&utm_campaign=wcaddons\";s:5:\"price\";s:9:\"&#36;0.00\";}i:3;O:8:\"stdClass\":5:{s:5:\"title\";s:15:\"Product Add-Ons\";s:5:\"image\";s:0:\"\";s:7:\"excerpt\";s:121:\"<span style=\"font-weight: 400;\">Give your customers the option to customize their purchase or add personalization.</span>\";s:4:\"link\";s:108:\"https://woocommerce.com/products/product-add-ons/?utm_source=product&utm_medium=upsell&utm_campaign=wcaddons\";s:5:\"price\";s:10:\"&#36;49.00\";}i:4;O:8:\"stdClass\":5:{s:5:\"title\";s:25:\"WooCommerce Subscriptions\";s:5:\"image\";s:62:\"https:/